contracts/cgateStaking.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

interface IPancakeRouter {
    function getAmountIn(
        uint256 amountOut,
        uint256 reserveIn,
        uint256 reserveOut
    ) external view returns (uint256 amountIn);
}

interface IPancakeFactory {
    function getPair(
        address tokenA,
        address tokenB
    ) external view returns (address pairContract);
}

interface IPancakePairContract {
    function getReserves()
        external
        view
        returns (uint112 reserve0, uint112 reserve1, uint32 blockTimestampLast);
}

interface IUniswapV3Pool {
    struct Slot0 {
        uint160 sqrtPriceX96;
        int24 tick;
        uint16 observationIndex;
        uint16 observationCardinality;
        uint16 observationCardinalityNext;
        uint32 feeProtocol;
        bool unlocked;
    }

    function slot0() external view returns (Slot0 memory);
}

contract StakingPoolV3 is Initializable, ReentrancyGuardUpgradeable {
    using SafeERC20 for IERC20;
    address public admin;
    uint256 private poolIdCounter;
    uint256 oneYear;
    uint256 price;

    address public proposedOwner;
    address[] public voters;
    mapping(address => bool) public hasVoted;

    address public PANCAKE_ROUTER_ADDRESS;
    address public CG8_TOKEN_ADDRESS;
    address public USDC_TOKEN_ADDRESS;
    address public PANCAKE_FACTORY_ADDRESS;

    struct Pool {
        uint256 timePeriod;
        address stakeToken;
        address rewardToken;
        uint256 rewardPercentPerStakedTokenPerYear;
        uint256 referralRewardPercent; // in BIPS i.e for 10% - 1000
        bool isActive;
        uint256 totalStakes;
    }

    struct UserInfo {
        uint256 totalStaked;
        uint256 activeStakes;
        uint256 totalRewardWithdrawnTillNow;
        uint256 referralIncomeWithdrawnTillNow;
        uint256 totalReferrers;
    }

    struct UserStake {
        uint256 amount;
        uint256 lastWithdrawTimestamp;
        uint256 rewardWithdrawnTillNow;
        uint256 stakeTime;
        address referrer;
        uint256 depositedValueInDollars;
    }

    mapping(uint256 => Pool) public pools;
    mapping(address => mapping(uint256 => UserStake[])) public userStakes;
    mapping(address => address) public referrers;

    mapping(address => uint256) public specialReferrersPercents;
    mapping(address => UserInfo) public users;
    mapping(address => mapping(uint256 => uint256)) public usersStakesPerPool;
    mapping(address => bool) public signers;
    address public poolAddress;
    mapping(address => mapping(uint256 => address[])) public referrals; // Update referrals mapping to include pool ID
    mapping(address => mapping(address => mapping(uint256 => uint256))) public referrerRewards; // Update referrer rewards mapping to include pool ID
    mapping(address => mapping(uint256 => address)) public poolReferrers;
    event OwnershipTransferProposed(address indexed newOwner);
    event VoteCasted(address indexed voter, bool approve);

    function initialize(address[] memory _initialVoters) public initializer {
        __ReentrancyGuard_init();
        admin = msg.sender;
        oneYear = 365 days;
        price = 1000000000000;
        PANCAKE_ROUTER_ADDRESS = 0x9Ac64Cc6e4415144C455BD8E4837Fea55603e5c3;
        CG8_TOKEN_ADDRESS = 0x9f7b09eb38ed912aB5932dCcAD0b1F501aBFE6Fd;
        USDC_TOKEN_ADDRESS = 0xd1Fac5Ff5d03b70D3383909692d09Fc6d97c8219;
        PANCAKE_FACTORY_ADDRESS = 0xB7926C0430Afb07AA7DEfDE6DA862aE0Bde767bc;
        for (uint256 i = 0; i < _initialVoters.length; i++) {
            voters.push(_initialVoters[i]);
        }
    }

    modifier onlyVoter() {
        require(isVoter(msg.sender), "Not a valid voter");
        _;
    }
    modifier onlyIfNotVoted() {
        require(!hasVoted[msg.sender], "Already voted");
        _;
    }
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can call this function");
        _;
    }

    modifier isValidPool(uint256 poolId) {
        require(poolId >= 0 && poolId < poolIdCounter, "Invalid Pool");
        _;
    }

    modifier isActivePool(uint256 poolId) {
        require(pools[poolId].isActive, "Pool Is Not Active");
        _;
    }

    function setPoolAddress(address _poolAddress) external onlyAdmin {
        poolAddress = _poolAddress;
    }

    function isVoter(address _addr) internal view returns (bool) {
        for (uint256 i = 0; i < voters.length; i++) {
            if (voters[i] == _addr) {
                return true;
            }
        }
        return false;
    }

    function proposeOwnershipTransfer(address newOwner) external onlyAdmin {
        require(newOwner != address(0), "New owner cannot be zero address");
        proposedOwner = newOwner;
        emit OwnershipTransferProposed(newOwner);
    }

    function cancelOwnershipTransfer() external onlyAdmin {
        proposedOwner = address(0);
        for (uint256 i = 0; i < voters.length; i++) {
            hasVoted[voters[i]] = false;
        }
    }

    function castVote(bool approve) external onlyVoter onlyIfNotVoted {
        hasVoted[msg.sender] = true;
        emit VoteCasted(msg.sender, approve);
    }

    function finalizeOwnershipTransfer() external onlyAdmin {
        uint256 approvalCount = 0;
        uint256 totalVoters = voters.length;

        for (uint256 i = 0; i < totalVoters; i++) {
            if (hasVoted[voters[i]]) {
                approvalCount++;
            }
        }

        // Assuming that more than half of the voters should approve
        bool approve = (approvalCount == totalVoters);

        require(approve, "Insufficient approvals");

        address newOwner = proposedOwner;

        admin = newOwner;

        // Reset voting state
        proposedOwner = address(0);
        for (uint256 i = 0; i < totalVoters; i++) {
            hasVoted[voters[i]] = false;
        }
    }

    function getPair(
        address tokenA,
        address tokenB
    ) public view returns (address) {
        address pair = IPancakeFactory(PANCAKE_FACTORY_ADDRESS).getPair(
            tokenA,
            tokenB
        );
        return pair;
    }

    function getReserves(
        address pair
    ) public view returns (uint112 reserve0, uint112 reserve1) {
        (uint112 reserveA, uint112 reserveB, ) = IPancakePairContract(pair)
            .getReserves();
        return (reserveA, reserveB);
    }

    function convertToWei(uint256 amount) internal pure returns (uint256) {
        return amount * 1 ether; // Assuming 1 token = 1 ether, adjust accordingly
    }

    function convertToEther(uint256 amount) internal pure returns (uint256) {
        return amount / 1 ether; // Assuming 1 token = 1 ether, adjust accordingly
    }

    function getPrice() public view returns (uint256) {
        IUniswapV3Pool pool = IUniswapV3Pool(poolAddress);
        uint160 sqrtPriceX96 = pool.slot0().sqrtPriceX96;

        uint256 sqrtPriceX96Uint = uint256(sqrtPriceX96);
        // Calculate the price using the formula provided
        uint256 price = (sqrtPriceX96Uint * sqrtPriceX96Uint * 1e18) /
            (1 << 192);

        return price;
    }

    function getPriceInverse() public view returns (uint256) {
        IUniswapV3Pool pool = IUniswapV3Pool(poolAddress);
        uint160 sqrtPriceX96 = pool.slot0().sqrtPriceX96;

        uint256 sqrtPriceX96Uint = uint256(sqrtPriceX96);

        uint256 price = (sqrtPriceX96Uint * sqrtPriceX96Uint * 1e18) /
            (1 << 192);

        uint256 inversePrice = (1e36) / price;

        return inversePrice;
    }

    function getCurrentCgatePrice() public view returns (uint256) {
        address pair = getPair(CG8_TOKEN_ADDRESS, USDC_TOKEN_ADDRESS);
        if (pair == address(0)) {
            return 0;
        }
        (uint112 reserveA, uint112 reserveB) = getReserves(pair);
        uint256 _price = IPancakeRouter(PANCAKE_ROUTER_ADDRESS).getAmountIn(
            1e18,
            reserveB,
            reserveA
        );

        return _price;
    }

    function getTotalPoolsCount() external view returns (uint256) {
        return poolIdCounter;
    }

    function getPendingReward(
        uint256 poolId,
        uint256 stakeId,
        address user
    ) public view isValidPool(poolId) isActivePool(poolId) returns (uint256) {
        require(userStakes[user][poolId].length > stakeId, "User Not Staked");
        UserStake storage userStake = userStakes[user][poolId][stakeId];
        Pool storage pool = pools[poolId];
        uint256 currentTime = block.timestamp;

        uint256 stakedTime = currentTime - userStake.lastWithdrawTimestamp;
        uint256 reward = ((userStake.depositedValueInDollars * stakedTime) *
            pool.rewardPercentPerStakedTokenPerYear) /
            10000 /
            oneYear;
        return reward;
    }

    function createStakingPool(
        uint256 _timePeriod,
        address _stakeToken,
        address _rewardToken,
        uint256 _rewardPercent,
        uint256 _referralRewardPercent
    ) external onlyAdmin nonReentrant {
        pools[poolIdCounter] = Pool(
            _timePeriod,
            _stakeToken,
            _rewardToken,
            _rewardPercent,
            _referralRewardPercent,
            true,
            0
        );
        poolIdCounter++;
    }

    function stake(
        uint256 poolId,
        uint256 _amount,
        address referrer
    ) external isValidPool(poolId) isActivePool(poolId) {
        require(_amount > 0, "Amount must be greater than 0");
        require(msg.sender != referrer, "You can't refer yourself");
        Pool storage pool = pools[poolId];

        // Transfer tokens from the user to this contract for staking
        require(
            IERC20(pool.stakeToken).transferFrom(
                msg.sender,
                address(this),
                _amount
            ),
            "Token transfer failed"
        );

        userStakes[msg.sender][poolId].push(
            UserStake({
                amount: _amount,
                lastWithdrawTimestamp: block.timestamp,
                rewardWithdrawnTillNow: 0,
                stakeTime: block.timestamp,
                referrer: referrer,
                depositedValueInDollars: (_amount * getPriceInverse()) / 1e18
            })
        );

        pools[poolId].totalStakes += _amount;

        users[msg.sender] = UserInfo({
            totalStaked: users[msg.sender].totalStaked + _amount,
            activeStakes: users[msg.sender].activeStakes + _amount,
            totalRewardWithdrawnTillNow: users[msg.sender]
                .totalRewardWithdrawnTillNow,
            referralIncomeWithdrawnTillNow: users[msg.sender]
                .referralIncomeWithdrawnTillNow,
            totalReferrers: users[msg.sender].totalReferrers
        });

        if (referrer != address(0)) {

            if (poolReferrers[msg.sender][poolId] == address(0)) {
                poolReferrers[msg.sender][poolId] = referrer;
                referrals[referrer][poolId].push(msg.sender);
                users[referrer].totalReferrers += 1;
            }
        }

        usersStakesPerPool[msg.sender][poolId] += _amount;
    }

    function updateCurrentCgatePrice(uint256 newPrice) public onlyAdmin {
        price = newPrice;
    }

    function unStakeIndividual(
        uint256 poolId,
        uint256 _stakeId
    ) external isValidPool(poolId) isActivePool(poolId) {
        UserStake storage userStake = userStakes[msg.sender][poolId][_stakeId];
        Pool storage pool = pools[poolId];

        require(userStake.amount >= 0, "Insufficient staked amount");

        uint256 currentTime = block.timestamp;
        require(
            currentTime >= userStake.stakeTime + pool.timePeriod,
            "Time period not passed"
        );

        claimIndividualReward(poolId, _stakeId);

        // Update the lastWithdrawTimestamp
        userStake.lastWithdrawTimestamp = currentTime;

        // Transfer the staked tokens back to the user
        require(
            IERC20(pool.stakeToken).transfer(msg.sender, userStake.amount),
            "Staked token transfer failed"
        );
        users[msg.sender].activeStakes -= userStake.amount;
        usersStakesPerPool[msg.sender][poolId] -= userStake.amount;
        pools[poolId].totalStakes -= userStake.amount;
        // Reduce the staked amount
        userStake.amount = 0;
        userStake.depositedValueInDollars = 0;

        // delete userStakes[msg.sender][poolId][_stakeId];
    }

    function unStake(
        uint256 poolId
    ) external isValidPool(poolId) isActivePool(poolId) {
        uint256 totalAmount = 0;
        Pool storage pool = pools[poolId];
        for (
            uint256 stakeId = 0;
            stakeId < userStakes[msg.sender][poolId].length;
            stakeId++
        ) {
            UserStake storage userStake = userStakes[msg.sender][poolId][
                stakeId
            ];

            uint256 currentTime = block.timestamp;
            if (currentTime >= userStake.stakeTime + pool.timePeriod) {
                totalAmount += userStake.amount;
                claimIndividualReward(poolId, stakeId);
                userStake.amount = 0;

                // Update the lastWithdrawTimestamp
                userStake.lastWithdrawTimestamp = currentTime;

                // If the staked amount becomes zero, delete record
                if (userStake.amount == 0) {
                    delete userStakes[msg.sender][poolId][stakeId];
                }
            }
        }
        users[msg.sender].activeStakes -= totalAmount;
        usersStakesPerPool[msg.sender][poolId] -= totalAmount;
        if (totalAmount > 0) {
            require(
                IERC20(pool.stakeToken).transfer(msg.sender, totalAmount),
                "Staked token transfer failed"
            );
        }
    }

    function claimIndividualReward(
        uint256 poolId,
        uint256 stakeId
    ) public isValidPool(poolId) isActivePool(poolId) returns (uint256) {
        UserStake storage userStake = userStakes[msg.sender][poolId][stakeId];
        Pool storage pool = pools[poolId];
        if (userStake.amount == 0) {
            return 0;
        }
        uint256 currentTime = block.timestamp;
        uint256 reward = getPendingReward(poolId, stakeId, msg.sender);
        if (reward > 0) {
            require(
                IERC20(pool.rewardToken).transfer(msg.sender, reward),
                "Reward transfer failed"
            );

            if (userStake.referrer != address(0)) {
                uint256 refRewardPercent = pool.referralRewardPercent;
                if (specialReferrersPercents[userStake.referrer] > 0) {
                    refRewardPercent = specialReferrersPercents[
                        userStake.referrer
                    ];
                }
                uint256 refReward = (reward * refRewardPercent) / 10000;
                if (refReward > 0) {
                    require(
                        IERC20(pool.rewardToken).transfer(
                            userStake.referrer,
                            refReward
                        ),
                        "Referral Reward transfer failed"
                    );
                    referrerRewards[userStake.referrer][msg.sender][poolId] += refReward; // Update referrer rewards record
                }

                users[userStake.referrer].referralIncomeWithdrawnTillNow += refReward;
            }
            users[msg.sender].totalRewardWithdrawnTillNow += reward;

            userStake.rewardWithdrawnTillNow += reward;
            userStake.lastWithdrawTimestamp = currentTime;
            return reward;
        }
    }

    function claimReward(
        uint256 poolId
    ) public isValidPool(poolId) nonReentrant isActivePool(poolId) {
        Pool storage pool = pools[poolId];
        uint256 totalReward = 0;
        for (
            uint256 stakeId = 0;
            stakeId < userStakes[msg.sender][poolId].length;
            stakeId++
        ) {
            UserStake storage userStake = userStakes[msg.sender][poolId][
                stakeId
            ];

            if (userStake.amount > 0) {
                uint256 currentTime = block.timestamp;
                uint256 reward = getPendingReward(poolId, stakeId, msg.sender);

                if (userStake.referrer != address(0)) {
                    uint256 refRewardPercent = pool.referralRewardPercent;
                    if (specialReferrersPercents[userStake.referrer] > 0) {
                        refRewardPercent = specialReferrersPercents[
                            userStake.referrer
                        ];
                    }
                    uint256 refReward = (reward * refRewardPercent) / 10000;
                    if (refReward > 0) {
                        require(
                            IERC20(pool.rewardToken).transfer(
                                userStake.referrer,
                                refReward
                            ),
                            "Referral Reward transfer failed"
                        );
                        referrerRewards[userStake.referrer][msg.sender][poolId] += refReward; // Update referrer rewards record
                        users[userStake.referrer]
                            .referralIncomeWithdrawnTillNow +=
                            refReward;
                    }
                }
                users[msg.sender].totalRewardWithdrawnTillNow += reward;

                userStake.rewardWithdrawnTillNow += reward;
                userStake.lastWithdrawTimestamp = currentTime;
                totalReward += reward;
            }
        }
        if (totalReward > 0) {
            require(
                IERC20(pool.rewardToken).transfer(msg.sender, totalReward),
                "Reward transfer failed"
            );
        }
    }

    function setAdmin(address newAdmin) external onlyAdmin {
        admin = newAdmin;
    }

    function setRewardToken(
        uint256 poolId,
        address _newRewardToken
    ) external onlyAdmin nonReentrant isValidPool(poolId) isActivePool(poolId) {
        require(poolId > 0 && poolId <= poolIdCounter, "Invalid pool ID");
        pools[poolId].rewardToken = _newRewardToken;
    }

    function setRewardPercent(
        uint256 poolId,
        uint256 _newRewardPercentInBIPS
    ) external onlyAdmin nonReentrant isValidPool(poolId) isActivePool(poolId) {
        require(poolId > 0 && poolId <= poolIdCounter, "Invalid pool ID");
        pools[poolId]
            .rewardPercentPerStakedTokenPerYear = _newRewardPercentInBIPS;
    }

    function setTimePeriod(
        uint256 poolId,
        uint256 _newTimePeriod
    ) external onlyAdmin isValidPool(poolId) isActivePool(poolId) {
        require(poolId > 0 && poolId <= poolIdCounter, "Invalid pool ID");
        pools[poolId].timePeriod = _newTimePeriod;
    }

    function setReferralRewardPercent(
        uint256 poolId,
        uint256 newPercentInBIPS
    ) external onlyAdmin isValidPool(poolId) isActivePool(poolId) {
        pools[poolId].referralRewardPercent = newPercentInBIPS;
    }

    function togglePoolStatus(
        uint256 poolId
    ) external onlyAdmin isValidPool(poolId) {
        pools[poolId].isActive = !pools[poolId].isActive;
    }

    function setSpecialReferrerRewardPercent(
        address _referrer,
        uint256 _percentInBIPS
    ) external onlyAdmin {
        specialReferrersPercents[_referrer] = _percentInBIPS;
    }

    function getTotalPendingRewardsForPool(
        uint256 poolId,
        address user
    ) public view returns (uint256) {
        uint256 total = 0;
        for (uint256 i = 0; i < userStakes[user][poolId].length; i++) {
            total += getPendingReward(poolId, i, user);
        }
        return total;
    }

    function withdrawEth(
        address payable _receiver
    ) external onlyAdmin nonReentrant {
        require(_receiver != address(0), "Invalid address");

        _receiver.transfer(address(this).balance);
    }

    function withdrawDumpToken(
        address receiver,
        IERC20 _token
    ) external onlyAdmin nonReentrant {
        _token.transfer(receiver, _token.balanceOf(address(this)));
    }

    function totalStakeCount(
        address user,
        uint256 poolId
    ) public view returns (uint256 count) {
        return userStakes[user][poolId].length;
    }

    function totalUnstakeAllowed(
        address user,
        uint256 poolId
    ) public view returns (uint256 totalWithdrawable) {
        uint256 totalAmount = 0;
        if (usersStakesPerPool[user][poolId] > 0) {
            for (uint256 i = 0; i < totalStakeCount(user, poolId); i++) {
                if (
                    userStakes[user][poolId][i].stakeTime +
                        pools[poolId].timePeriod <=
                    block.timestamp
                ) {
                    totalAmount += userStakes[user][poolId][i].amount;
                }
            }
        }
        return totalAmount;
    }

    function setRouter(address _router) external onlyAdmin {
        PANCAKE_ROUTER_ADDRESS = _router;
    }

    function setFactory(address _factory) external onlyAdmin {
        PANCAKE_FACTORY_ADDRESS = _factory;
    }

    function setCg8Address(address _cg8Address) external onlyAdmin {
        CG8_TOKEN_ADDRESS = _cg8Address;
    }

    function setUSDCAddress(address _usdcAddress) external onlyAdmin {
        USDC_TOKEN_ADDRESS = _usdcAddress;
    }

    // New Functions

    function getTotalReferralRewards(address user) external view returns (uint256) {
        uint256 totalReferralRewards = 0;
        for (uint256 poolId = 0; poolId < poolIdCounter; poolId++) {
            for (uint256 i = 0; i < referrals[user][poolId].length; i++) {
                totalReferralRewards += referrerRewards[user][referrals[user][poolId][i]][poolId];
            }
        }
        return totalReferralRewards;
    }

    function getReferrals(address user, uint256 poolId) external view returns (address[] memory) {
        return referrals[user][poolId];
    }

    function getTotalReferralRewardByReferrer(address user, address referrer) external view returns (uint256) {
        uint256 totalReferralReward = 0;
        for (uint256 poolId = 0; poolId < poolIdCounter; poolId++) {
            totalReferralReward += referrerRewards[referrer][user][poolId];
        }
        return totalReferralReward;
    }
}

contracts/cgateToken.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/utils/math/SafeMathUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/ERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/extensions/ERC20BurnableUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract CG8 is
    Initializable,
    ERC20Upgradeable,
    ERC20BurnableUpgradeable,
    OwnableUpgradeable,
    PausableUpgradeable,
    ReentrancyGuardUpgradeable
{
    using SafeMathUpgradeable for uint256;
    using SafeERC20 for IERC20;

    address public proposedOwner;
    address[] public voters;
    mapping(address => bool) public hasVoted;

    address public _owner;
    uint256 public minTransactionAmount; // Minimum transaction amount
    uint256 public maxTransactionAmount; // Maximum transaction amount
    uint256 public transferDelay; // Transfer delay period

    uint256 public lockedLiquidityAmount; // Amount of liquidity tokens locked
    bool public liquidityLocked; // Flag to track if liquidity is locked

    bool public isDeflationary; // Deflationary state flag

    mapping(address => bool) public isExcludedFromTax;

    uint256 public burnableTax; // 0.5%
    uint256 public graduallyDecreasingTax; // 0.2%
    uint256 public buySellTaxRate; // Rate at which gradually decreasing tax decreases
    uint256 public decreasingTaxInterval; // 1 hr
    uint256 public lastUpdatedTaxTimestamp; // Timestamp of the last tax update
    bool public isBuySellTaxEnabled;
    address public usdt;

    struct Vesting {
        uint256 amount;
        address beneficiary;
        uint256 percentageOfTokensToBeReleased;
        uint256 timeInterval;
        uint256 lastWithdrawTimestamp;
        uint256 claimedTokens;
    }

    mapping(address => bool) private isBlacklisted;
    mapping(address => uint256) private _transferAllowedAt;
    mapping(address => uint256) public _frozenWallets;
    mapping(address => bool) private _whitelistedWallets;
    mapping(address => bool) public signers;
    mapping(address => Vesting) public vestingInfo;

    address public router;
    uint256 public maxSupply;

    // Tracking holders
    mapping(address => bool) private holders;
    uint256 public holdersCount;

    event OwnershipTransferProposed(address indexed newOwner);
    event VoteCasted(address indexed voter, bool approve);

    function initialize(
        string memory _name,
        string memory _symbol,
        uint8 _decimals,
        uint256 _initialSupply,
        address _router,
        address[] memory _initialVoters
    ) public initializer {
        _owner = msg.sender;
        __ERC20_init(_name, _symbol);
        __ERC20Burnable_init();
        __Ownable_init();
        __Pausable_init();
        __ReentrancyGuard_init();
        usdt = 0x0285e1D847B88056ADd3823C456eE83D37cDD60a;
        burnableTax = 50; // 0.5%
        graduallyDecreasingTax = 5000; // 0.2%
        isBuySellTaxEnabled = true;
        buySellTaxRate = 2000; // Rate at which gradually decreasing tax decreases
        decreasingTaxInterval = 300; // 5 min
        isDeflationary = true; // Deflationary state flag
        minTransactionAmount = 0; // Minimum transaction amount
        maxTransactionAmount = 100 ether;
        _mint(_owner, _initialSupply * (10**uint256(_decimals)));
        isBlacklisted[msg.sender] = false;
        _whitelistedWallets[msg.sender] = true;
        _transferAllowedAt[msg.sender] = block.timestamp;
        router = _router;
        isExcludedFromTax[address(this)] = true;
        maxSupply = 1000000000 ether;
        isExcludedFromTax[router] = true;
        for (uint256 i = 0; i < _initialVoters.length; i++) {
            voters.push(_initialVoters[i]);
        }
        // Initialize holders tracking
        if (_initialSupply > 0) {
            holders[_owner] = true;
            holdersCount = 1;
        }
    }

    modifier onlyVoter() {
        require(isVoter(msg.sender), "Not a valid voter");
        _;
    }
    modifier onlyIfNotVoted() {
        require(!hasVoted[msg.sender], "Already voted");
        _;
    }

    // Modifier to check if liquidity is locked
    modifier liquidityNotLocked() {
        require(!liquidityLocked, "Liquidity is locked");
        _;
    }

    modifier whenNotFrozen(address wallet) {
        require(
            _frozenWallets[wallet] == 0 ||
                block.timestamp > _frozenWallets[wallet],
            "Wallet is frozen"
        );
        _;
    }

    modifier checkAmount(address wallet, uint256 amount) {
        if (!_whitelistedWallets[wallet]) {
            require(amount >= minTransactionAmount, "Amount below minimum");
            require(amount <= maxTransactionAmount, "Amount exceeds maximum");
        }
        _;
    }

    function isVoter(address _addr) internal view returns (bool) {
        for (uint256 i = 0; i < voters.length; i++) {
            if (voters[i] == _addr) {
                return true;
            }
        }
        return false;
    }

    function proposeOwnershipTransfer(address newOwner) external onlyOwner {
        require(newOwner != address(0), "New owner cannot be zero address");
        proposedOwner = newOwner;
        emit OwnershipTransferProposed(newOwner);
    }

    function setIsExcludedFromTax(address wallet) external onlyOwner {
        isExcludedFromTax[wallet] = true;
    }

    function includeInTax(address wallet) external onlyOwner {
        isExcludedFromTax[wallet] = false;
    }

    function setRouter(address _newRouter) external onlyOwner {
        router = _newRouter;
        isExcludedFromTax[router] = true;
    }

    function mint(address account, uint256 amount)
        public
        onlyOwner
        nonReentrant
    {
        uint256 _totalSupply = totalSupply();
        require(
            _totalSupply + amount <= maxSupply,
            "Supply Reached Max Supply"
        );
        _mint(account, amount);
    }

    function cancelOwnershipTransfer() external onlyOwner {
        proposedOwner = address(0);
        for (uint256 i = 0; i < voters.length; i++) {
            hasVoted[voters[i]] = false;
        }
    }

    function castVote(bool approve) external onlyVoter onlyIfNotVoted {
        hasVoted[msg.sender] = approve;
        emit VoteCasted(msg.sender, approve);
    }

    function removeVoter(address _voterAddress) external onlyOwner {
        // Find the index of the voter in the voters array
        uint256 voterIndex;
        bool found = false;
        for (uint256 i = 0; i < voters.length; i++) {
            if (voters[i] == _voterAddress) {
                voterIndex = i;
                found = true;
                break;
            }
        }

        // If the voter is found, remove them from the array
        if (found) {
            voters[voterIndex] = voters[voters.length - 1];
            voters.pop();
        }
    }

    function finalizeOwnershipTransfer() external onlyOwner {
        uint256 approvalCount = 0;
        uint256 totalVoters = voters.length;

        for (uint256 i = 0; i < totalVoters; i++) {
            if (hasVoted[voters[i]]) {
                approvalCount++;
            }
        }

        // Assuming that more than half of the voters should approve
        bool approve = (approvalCount == totalVoters);

        require(approve, "Insufficient approvals");

        address previousOwner = _owner;
        address newOwner = proposedOwner;

        // Transfer ownership
        _owner = newOwner;
        super.transferOwnership(newOwner);

        // Reset voting state
        proposedOwner = address(0);
        for (uint256 i = 0; i < totalVoters; i++) {
            hasVoted[voters[i]] = false;
        }

        emit OwnershipTransferred(previousOwner, newOwner);
    }

    function blackList(address _user) external onlyOwner {
        require(!isBlacklisted[_user], "user already blacklisted");
        isBlacklisted[_user] = true;
    }

    function removeFromBlacklist(address _user) external onlyOwner {
        require(isBlacklisted[_user], "user already blacklisted");
        isBlacklisted[_user] = false;
    }

    function isBlackList(address _user) public view returns (bool) {
        return isBlacklisted[_user];
    }

    function setMinTransactionAmount(uint256 amount) external onlyOwner {
        minTransactionAmount = amount;
    }

    function setMaxTransferAmount(uint256 amount) external onlyOwner {
        maxTransactionAmount = amount;
    }

    function setTransferDelay(uint256 delay) external onlyOwner {
        transferDelay = delay;
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

    function addToWhitelist(address wallet) external onlyOwner {
        _whitelistedWallets[wallet] = true;
    }

    function removeFromWhitelist(address wallet) external onlyOwner {
        _whitelistedWallets[wallet] = false;
    }

    function transferAllowedAt() external view returns (uint256) {
        return _transferAllowedAt[msg.sender];
    }

    // Enable or disable deflationary mechanism
    function setDeflationary(bool _enabled) external onlyOwner {
        isDeflationary = _enabled;
    }

    function disableBuySellTax(bool _enabled) external onlyOwner {
        isBuySellTaxEnabled = _enabled;
    }

    function setBurnableTax(uint256 _burnableTax) external {
        burnableTax = _burnableTax;
    }

    function isWhitelisted(address user) public view returns (bool) {
        return _whitelistedWallets[user];
    }

    function freezeWallet(address wallet, uint256 freezeDuration)
        external
        onlyOwner
    {
        require(wallet != address(0), "Invalid wallet address");
        _frozenWallets[wallet] = block.timestamp + freezeDuration;
    }

    function unfreezeWallet(address wallet) external onlyOwner {
        _frozenWallets[wallet] = 0;
    }

    // Function to update the gradually decreasing tax rate
    function updateGraduallyDecreasingTax() public {
        uint256 timeSinceLastUpdate = block.timestamp - lastUpdatedTaxTimestamp;
        if (timeSinceLastUpdate >= decreasingTaxInterval) {
            if ((10000 - buySellTaxRate) <= 0) {
                graduallyDecreasingTax = 0;
                lastUpdatedTaxTimestamp = block.timestamp;
                return;
            }
            // Calculate the new tax rate
            buySellTaxRate =
                buySellTaxRate -
                ((graduallyDecreasingTax * buySellTaxRate) / 10000);

            lastUpdatedTaxTimestamp = block.timestamp;
        }
    }

    function setGraduallyDecreasingTaxZero() external onlyOwner {
        graduallyDecreasingTax = 0;
    }

    function setGraduallyDecreasingTax(uint256 tax) external onlyOwner {
        graduallyDecreasingTax = tax;
    }

    function setGraduallyDecreasingInterval(uint256 _decreasingTaxInterval)
        external
        onlyOwner
    {
        decreasingTaxInterval = _decreasingTaxInterval;
    }

    function setBuySellTaxRate(uint256 _rate) external onlyOwner {
        buySellTaxRate = _rate;
    }

    function setUSDTAddress(address _usdt) external onlyOwner {
        usdt = _usdt;
    }

    function transfer(
        address recipient,
        uint256 amount
    )
        public
        override
        whenNotPaused
        whenNotFrozen(msg.sender)
        checkAmount(msg.sender, amount)
        nonReentrant
        returns (bool)
    {
        require(!isBlacklisted[msg.sender], "Sender's wallet is blacklisted");
        require(
            _transferAllowedAt[msg.sender] <= block.timestamp,
            "Transfer not allowed yet"
        );
        _transferAllowedAt[msg.sender] = block.timestamp + transferDelay;

        _updateHoldersOnTransfer(msg.sender, recipient, amount);
        _transfer(msg.sender, recipient, amount); // Transfer without burning

        return true;
    }

    function transferFrom(
        address from,
        address to,
        uint256 amount
    )
        public
        override
        whenNotFrozen(from)
        checkAmount(msg.sender, amount)
        nonReentrant
        returns (bool)
    {
        require(!isBlacklisted[from], "Sender's wallet is blacklisted");
        require(
            _transferAllowedAt[msg.sender] <= block.timestamp,
            "Transfer not allowed yet"
        );
        _transferAllowedAt[msg.sender] = block.timestamp + transferDelay;

        _spendAllowance(from, msg.sender, amount);
        _updateHoldersOnTransfer(from, to, amount);
        _transfer(from, to, amount);

        return true;
    }

    // Transfer function with auto liquidity and tax
    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal virtual override checkAmount(sender, amount) {
        require(!isBlacklisted[sender], "Sender's wallet is blacklisted");
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(
            recipient != address(0),
            "ERC20: transfer to the zero address"
        );
        require(amount > 0, "Transfer amount must be greater than zero");

        uint256 initialAmount = amount;

        if (isExcludedFromTax[sender] || isExcludedFromTax[recipient]) {
            super._transfer(sender, recipient, amount);
            return;
        }
        if (isDeflationary) {
            uint256 burnAmount = ((initialAmount * burnableTax) / 10000); // Calculate the amount to burn
            _burn(sender, burnAmount); // Burn tokens
            amount = amount - burnAmount;
        }

        if (isBuySellTaxEnabled) {
            uint256 buySellTax = (buySellTaxRate * initialAmount) / 10000;
            super._transfer(sender, _owner, buySellTax);
            amount = amount - (buySellTaxRate * initialAmount) / 10000;
        }
        updateGraduallyDecreasingTax();

        // Transfer the remaining amount
        super._transfer(sender, recipient, amount);
    }

    function _updateHoldersOnTransfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal {
        if (balanceOf(sender) == amount) {
            holders[sender] = false;
            holdersCount = holdersCount.sub(1);
        }
        if (balanceOf(recipient) == 0) {
            holders[recipient] = true;
            holdersCount = holdersCount.add(1);
        }
    }

    function _mint(address account, uint256 amount) internal override {
        super._mint(account, amount);
        if (!holders[account]) {
            holders[account] = true;
            holdersCount = holdersCount.add(1);
        }
    }

    function _burn(address account, uint256 amount) internal override {
        super._burn(account, amount);
        if (balanceOf(account) == 0) {
            holders[account] = false;
            holdersCount = holdersCount.sub(1);
        }
    }

    receive() external payable {}

    // Function to lock liquidity
    function lockLiquidity(uint256 amount) external liquidityNotLocked {
        require(amount <= balanceOf(address(this)), "Insufficient balance");

        // Transfer the liquidity tokens to the contract itself
        transfer(address(this), amount);

        lockedLiquidityAmount = lockedLiquidityAmount.add(amount);
        liquidityLocked = true;
    }

    // Function to unlock locked liquidity
    function unlockLiquidity(uint256 amount) external {
        require(liquidityLocked, "Liquidity is not locked");
        require(lockedLiquidityAmount >= amount, "Not enough locked liquidity");

        // Transfer the locked liquidity tokens back to the contract owner
        transfer(_owner, amount);

        lockedLiquidityAmount = lockedLiquidityAmount.sub(amount);
        liquidityLocked = false;
    }

    function burnFrom(address account, uint256 amount)
        public
        virtual
        override
        onlyOwner
    {
        _burn(account, amount);
    }

    // Function to add vesting for a wallet
    function addVestingSchedule(
        address beneficiary,
        uint256 amount,
        uint256 percentageToRelease,
        uint256 timeInterval
    ) external onlyOwner {
        require(
            beneficiary != address(0),
            "Beneficiary address cannot be zero"
        );
        require(
            percentageToRelease > 0 && percentageToRelease <= 10000,
            "Percentage must be between 1 and 100"
        );
        require(timeInterval > 0, "Time interval must be greater than zero");
        Vesting storage vesting = vestingInfo[beneficiary];
        vesting.amount = amount;
        vesting.beneficiary = beneficiary;
        vesting.percentageOfTokensToBeReleased = percentageToRelease;
        vesting.timeInterval = timeInterval;
        vesting.lastWithdrawTimestamp = block.timestamp;
        vesting.claimedTokens = 0;
    }

    function claim() external {
        Vesting storage vesting = vestingInfo[msg.sender];
        require(vesting.amount > 0, "No vesting schedule found for the sender");

        uint256 currentTime = block.timestamp;
        uint256 elapsedTime = currentTime - vesting.lastWithdrawTimestamp;
        uint256 totalVested = vesting.amount;

        require(
            elapsedTime >= vesting.timeInterval,
            "Tokens cannot be claimed yet"
        );

        // Calculate the tokens to release in this claim
        uint256 tokensToRelease = (totalVested *
            vesting.percentageOfTokensToBeReleased) / 10000;
        vesting.claimedTokens += tokensToRelease;
        vesting.lastWithdrawTimestamp = currentTime;

        require(
            tokensToRelease <= totalVested,
            "Tokens to claim exceed total vested tokens"
        );
        require(
            vesting.claimedTokens <= vesting.amount,
            "Not enough tokens in the vesting schedule"
        );

        // Transfer the tokens to the beneficiary
        _transfer(_owner, msg.sender, tokensToRelease);
    }

    function withdrawEth(address payable _receiver) external onlyOwner {
        require(_receiver != address(0), "Invalid address");

        _receiver.transfer(address(this).balance);
    }

    function withdrawDumpToken(address receiver, IERC20 _token)
        external
        onlyOwner
    {
        _token.transfer(receiver, _token.balanceOf(address(this)));
    }

    function transferOwnership(address newOwner) public override onlyOwner {
        revert("Please Call Finalize Transfer Ownership");
    }
}

